import React from "react";
import styled from "styled-components";
import {colorsRoles} from "../../../01 Atoms/Colors";
import CodeSandBoxItem from "./CodeSandBoxItem";
import {fonts} from "../../../01 Atoms/globalStyle";
import CodeSandBox from "../../../../media/icons/methodology/code-sandbox.svg";


const CodeSandboxes = () => {
    return <>
        <Wrapper>
            <h2>CodeSanbox section</h2>
            <CodeSandoxItems>
                <CodeSandBoxItem/>
                <CodeSandBoxItem/>
                <CodeSandBoxItem/>
                <CodeSandBoxItem/>
                <CodeSandBoxItem/>
            </CodeSandoxItems>
        </Wrapper>

    </>

};

export default CodeSandboxes;

export const Wrapper = styled.div`
background-color: ${colorsRoles.White};

    & h2 {
    position: relative;
    ${fonts.PlayFairDisplay};
    font-size: 5rem;
    text-align: center;
    padding: 40px 0;

        &::before{
          position: absolute;
          content: "";
          display: block;
          width: 40px;
          height: 40px;
          background-image: url(${CodeSandBox});
          background-size: contain;
          top: 0;
          right: 0;
          bottom: 0;
          left: 0;
        }

    }

`;

export const CodeSandoxItems = styled.div`
display: flex;
`;
